import React from "react";
import Style from "./registrationForm.module.scss";
import {
  ColFields,
  ImageSelector,
  TextArea,
  Buttons,
  Title,
  FormFields,
} from "components/formFields";

export default function RegistrationForm() {
  return (
    <>
      <div className={Style.container}>
        <div className={Style.form__container}>
          <label className={Style.form__title__field}>
            <Title title={"Cadastro de veículos"} Style={Style} />
            <form className={Style.form__field} >
              <div className={Style.form}>
                <FormFields
                  type={"text"}
                  name={"NomeVeiculo"}
                  placeholder={"Nome do Veiculo"}
                />
                <FormFields
                  name={"Fabricante"}
                  placeholder={"Fabricante"}
                  type={"text"}
                />
                <FormFields
                  name={"Modelo"}
                  placeholder={"Modelo"}
                  type={"text"}
                />
                <FormFields name={"Ano"} placeholder={"Ano"} type={"number"} />
              </div>
              <div className={Style.form}>
                <div className={Style.form__media}>
                  <FormFields
                    name={"Câmbio"}
                    placeholder={"Câmbio"}
                    type={"text"}
                  />
                  <FormFields
                    name={"Potência"}
                    placeholder={"Potência (CV)"}
                    type={"text"}
                  />
                </div>
                <div className={Style.form__media}>
                <FormFields
                    name={"Torque"}
                    placeholder={"Torque (N.m)"}
                    type={"text"}
                  />
                  <FormFields name={"KM"} type={"number"} placeholder={"KM"} />
                </div>
              </div>
              <div className={Style.form}>
                <FormFields name={"Cor"} placeholder={"Cor"} type={"text"} />
                <FormFields
                  name={"Cabine"}
                  placeholder={"Cabine"}
                  type={"text"}
                />
                <FormFields
                  type={"text"}
                  name={"RelacaoDiferencial"}
                  placeholder={"Relação diferencial"}
                />
                <FormFields
                  name={"Suspensão"}
                  type={"text"}
                  placeholder={"Suspensão"}
                />
              </div>
              <div className={Style.form}>
                <div className={Style.form__media}>
                  <FormFields
                    name={"EntreEixos"}
                    placeholder={"Entre-eixos"}
                    type={"number"}
                  />
                  <FormFields
                    name={"Placa"}
                    placeholder={"Placa do veículo"}
                    type={"text"}
                  />
 <FormFields
                    name={"Cap. Max. Combustível"}
                    placeholder={"Cap. Max. Combustível"}
                    type={"text"}
                  />
                </div>
                <ColFields
                  type={"number"}
                  name={"Preço"}
                  placeholder={"Valor"}
                  Style={Style}
                  unidadeMedida={"R$"}
                />
              </div>
              <div className={Style.form__media__textarea}>
                <TextArea
                  name={"InfoAd"}
                  placeholder={"Informações opcionais"}
                  label={"Informações opcionais"}
                  Style={Style}
                />
                <TextArea
                  name={"InfoOp"}
                  placeholder={"Informações adicionais"}
                  label={"Informações adicionais"}
                  Style={Style}
                />
              </div>

              <div className={Style.buttons__field}>
                <ImageSelector label={"Selecionar múltiplas imagens"} />
                <Buttons
                  type={"reset"}
                  variant={"outline-danger"}
                  name={"Limpar"}
                />{" "}
                <Buttons
                  type={"submit"}
                  variant={"outline-success"}
                  name={"Cadastrar"}
                />
              </div>
            </form>
          </label>
        </div>
      </div>
    </>
  );
}
